    0130038)",nt"tracking_summary": {ntt"total": 1,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-02-26T22:17:01.003552",nt"name":
    "in-situ-navigational-physical-and-profile-data-collected-by-woods-hole-oceanographic-insti",nt"isopen":
    false,nt"url": null,nt"notes": "In situ, navigational, physical and profile
    oceanographic data were collected, including CURRENT SPEED - EAST/WEST COMPONENT
    (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), CURRENT SPEED - UP/DOWN COMPONENT
    (W), DEPTH - OBSERVATION, HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE, SALINITY and
    WATER TEMPERATURE from Moored Buoy at the Line W moored array (LINE-W) using C-T
    recorder, CTD, current meter and thermistor from 2001-10-05 to 2008-09-23. These
    data were provided to one of the OceanSITES Data Assembly Centers (DAC). The DAC
    formatted this information into the OceanSITES file format and passed it on to the
    Global Data Assembly Centers (GDAC).OceanSITES is a worldwide system of long-term,
    open-ocean reference stations measuring dozens of variables and monitoring the full
    depth of the ocean from air-sea interactions down to the seafloor. It is a network
    of stations or observatories measuring many aspects of the ocean's surface and water
    column using, where possible, automated systems with advanced sensors and telecommunications
    systems, yielding high time resolution, often in real-time, while building a long
    record.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
